import React from 'react'
import styled from 'styled-components'
import {Link} from 'react-router-dom'
import logo from '/home/coder/Documents/Info News/info-news-app/src/common/logo.png'

const Nav = styled.nav`
    background-color: black;
    height: 60px;
    display: flex;
    justify-content: space-between;
    position: fixed;
    width: 100%;
    cursor: pointer;
    margin-top: -20px;
    margin-left: -10px;
    align-items: center;
`
const Logo=styled(Link)`
    color: white;
    height: 100%;
    align-items: center;
    display: flex;
    padding: 0rem 1rem;
    text-decoration: none;
    font-weight: bold;

`

const NavBar = ()=>{
    return(
        <Nav>
            <Logo to="/"><img src={"./logo.png"} alt="img"/></Logo>

        </Nav>
    )
}
export default NavBar
